      'Taco Plate Casserole is a <b>gluten free</b> main course. This recipe serves 8 and costs $2.93 per serving. One portion of this dish contains around <b>42g of protein</b>, <b>58g of fat</b>, and a total of <b>943 calories</b>. 1 person were glad they tried this recipe. From preparation to the plate, this recipe takes roughly <b>1 hour</b>. This recipe is typical of Mexican cuisine. If you have taco seasoning, olives, onion powder, and a few other ingredients on hand, you can make it. It is perfect for <b>Autumn</b>. It is brought to you by Foodista. Taking all factors into account, this recipe <b>earns a spoonacular score of 56%</b>, which is solid. If you like this recipe, you might also like recipes such as <a href="https://spoonacular.com/recipes/barbecue-beef-taco-plate-419917">Barbecue Beef Taco Plate</a>, <a href="https://spoonacular.com/recipes/cakespy-easter-candy-dessert-taco-plate-199855">Cakespy: Easter Candy Dessert Taco Plate</a>, and <a href="https://spoonacular.com/recipes/taco-casserole-556113">Taco Casserole</a>.',
