    instructions:
      "<ol><li>Preheat oven to 350F.</li><li>In a large skillet over medium high heat, brown the ground beef, chorizo and chopped onion.</li><li>Drain any fat and add the taco seasoning, chili powder, garlic powder and onion powder. Stir well to combine.</li><li>Add the refried beans, tomatoes, soup and sliced olives; mix well and heat thoroughly.</li><li>Spray a 9 x 13 dish with non-stick cooking spray.</li><li>Reserve 2 cups of the meat mixture for the top of the casserole. Set aside.</li><li>Layer half the corn tortillas on the bottom. Then make a layer with half of the remaining meat mixture. Sprinkle one cup of the cheese on top and half of the crumbled tortilla chips. Repeat another layer of tortillas, meat, cheese and chips. Finish with the 2 cups of reserved meat mixture and the remaining 2 cups of cheese on top. Pour the salsa over the top and bake for 30 minutes. Garnish with sour cream and chopped green onions, if desired.</li></ol>",
